class MouseHandler {
    constructor() {
        this.x = undefined;
        this.y = undefined;
        this.radius = 100;
        this.__mousemoveHandler();
    }

    __mousemoveHandler() {
        window.addEventListener('mousemove', e => {
            this.x = e.x + cnv.clientLeft / 2;
            this.y = e.y + cnv.clientTop / 2;
        });
    }

    getX() {
        return this.x;
    }

    setX(val) {
        this.x = val;
    }

    getY() {
        return this.y;
    }

    setY(val) {
        this.y = val;
    }

    getRadius() {
        return this.radius;
    }
}


const cnv = document.getElementById('canvas');
const ctx = cnv.getContext('2d');
cnv.width = window.innerWidth;
cnv.height = window.innerHeight;
let particleArray = [];
const mouse = new MouseHandler();

function drawImage() {
    let imageWidth = png.width;
    let imageHeight = png.height;
    const data = ctx.getImageData(0, 0, imageWidth, imageHeight);
    ctx.clearRect(0, 0, cnv.width, cnv.height);

    class Particle {
        constructor(x, y, color, size) {
            this.x = x + cnv.width / 2 - png.width * 2;
            this.y = y + cnv.height / 2 - png.height * 2;
            this.size = 2;
            this.color = color;
            this.baseX = x + cnv.width / 2 - png.width * 2;
            this.baseY = y + cnv.height / 2 - png.height * 2;
            this.density = (Math.random() * 10) + 2;
        }

        // draw individual particle
        draw() {
            // return ctx => {
                ctx.beginPath();
                ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                ctx.closePath();
                ctx.fill();
            // } 
        }

        update() {
            ctx.fillStyle = this.color;
            // collision detection
            let dx = mouse.getX() - this.x;
            let dy = mouse.getY() - this.y;
            let distance = Math.sqrt(dx ** 2 + dy ** 2);
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;
            
            // max distance, past that the force going to be 0
            const maxDistance = 100;
            let force = (maxDistance - distance) / maxDistance;
            if (force < 0) force = 0;

            let directionX = (forceDirectionX * force * this.density * 0.6);
            let directionY = (forceDirectionY * force * this.density * 0.6);

            if (distance < mouse.getRadius() + this.size) {
                this.x -= directionX;
                this.y -= directionY;
            } else {
                if (this.x !== this.baseX) {
                    let dx = this.x - this.baseX;
                    this.x -= dx / 20;
                }
                if (this.y !== this.baseY) {
                    let dy = this.y - this.baseY;
                    this.y -= dy / 20;
                }
            }
            this.draw();
        }

        // factory
        static create(x, y, color, size) {
            return new Particle(x, y, color, size);
        }
    }

    function init() {
        particleArray = [];

        for (let y = 0, y2 = data.height; y < y2; y++) {
            for (let x = 0, x2 = data.width; x < x2; x++) {
                if (data.data[(y * 4 * data.width) + (x * 4) + 3] > 128) {
                    let positionX = x;
                    let positionY = y;
                    let color = `rgb(${
                        data.data[(y * 4 * data.width) + (x * 4)]
                    },${
                        data.data[(y * 4 * data.width) + (x * 4) + 1]
                    },${
                        data.data[(y * 4 * data.width) + (x * 4) + 2]
                    })`;
                    particleArray.push(Particle.create(
                        positionX * 4,
                        positionY * 4,
                        color
                    ));
                }
            }
        }
    }

    function animate() {
        // animate every particle
        requestAnimationFrame(animate);
        ctx.fillStyle = "rgba(0, 0, 0, .05)";
        ctx.fillRect(0, 0, innerWidth, innerHeight);

        for(let i = 0; i < particleArray.length; i++) {
            particleArray[i].update(mouse);
        }
    }

    init();
    animate();
}
const png = new Image();
png.src = "data:image/png;base64,"

window.addEventListener('load', () => {
    console.log('page loaded');
    ctx.drawImage(png, 0, 0);
    drawImage();
});
